import { GameObject } from "./GameObject"

export const Hierarchy = () => {
  return <div
    style={{
      overflow: `scroll`,
      userSelect: `none`
    }}
  >
    <GameObject
      object={window.files.scenes[window.editor.seletedScene]}
      main={true}
    />
    <div
      style={{
        cursor: `pointer`
      }}
    >
      + Add New GameObject
    </div>
  </div>
}
